from typing import Optional

class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

def print_from_head(head: ListNode):
    cur = head
    while cur is not None:
        print(f"{cur.val} > ", end="")
        cur = cur.next
    print()

def build_from_list(data: list[int]):
    head = None
    last_node = None
    for num in data:
        node = ListNode(num)
        if head is None:
            head = node
        if last_node is not None:
            last_node.next = node
        last_node = node
    return head

class Solution:

    def sortList(self, head: Optional[ListNode]) -> Optional[ListNode]:
        if head is None:
            return head

        node_list = []
        cur = head
        while cur is not None:
            cur_next = cur.next
            cur.next = None
            node_list.append(cur)
            cur = cur_next

        node_list.sort(key=lambda x: x.val)
        print(len(node_list))
        for i in range(1, len(node_list)):
            node_list[i - 1].next = node_list[i]
        head = node_list[0]
        return head

